import React, { useState } from 'react';
import '../css/homepage.css';
import { Link, useNavigate } from 'react-router-dom';


const Homepage = () => {
    const navigate = useNavigate();

    const handleLoginClick = () => {
        navigate('/login'); // Điều hướng đến route /login
    };
    return (

        <header class="header">
        <nav class="nav-links">
          <a href="#">Khám phá</a>
          <a href="#">Đặt vé</a>
          <a href="#">Thông tin hành trình</a>
        </nav>
        
          <a href="#" class="login">Đăng nhập</a>
          <a href="#" class="register">Đăng ký</a>
          <div class="user-icon">👤</div>


          <div className='homepage'>
            <div className='menu'>
                <nav>
                    <ul className='navbar'>                   
                        <div className='find_flight'>
                            <button id='find_flight' onClick={handleLoginClick}>Tìm chuyến bay</button>
                        </div>
                        <div className='book_ticket'>
                            <button id='book_ticket' onClick={handleLoginClick}>Đặt vé</button>
                        </div>
                        <div className='distance'></div>
                        <div className='login'>
                            {/* <Link to="/login">Login</Link> */}
                            <button id='login' onClick={handleLoginClick}>Đăng nhập</button>
                        </div>
                        <div className='register'>
                            <button id='register' onClick={handleLoginClick}>Đăng kí</button>
                            {/* <Link to="/register">Login</Link> */}
                        </div>
                    </ul>
                </nav>
            </div>
        </div>

      </header>
      
        
        
    );
};

export default Homepage;
